INSERT INTO `catalogsearch_fulltext` VALUES ('86','2',1,'TRC102|Enabled|None|Georgia Charm Necklace - Colored|Represent the Peach State with this Georgia Charm Necklace! Each piece is crafted by hand, using resin molds that I created myself. The opaque resin comes in many colors - interesting and unique! The necklace includes a 24-inch chain.|Georgia State Charm Necklace with 24 inch Necklace Chain - Colored|45|1'),('103','14',1,'KRC104|Enabled|Taxable Goods|Bronze Bulldog Sculpture|This rugged, angry bulldog is standing his ground and challenging anybody or anything to try and make him move! Great mascot statue for home, office or garden. This bulldog mascot is fabricated and sculpted from various unique quality materials including fiberglass and sealed bronze metal coatings for indoor or outdoor placement. Bruiser has a slightly wider head than \'Junkyard Dawg\'. Feel free to contact me if you have any other questions regarding this bulldog. Please add $65.00 for attached fiberglass plate and $45.00 for letter of choice on chest. Overall size: 23\" L x 14.5\" W x 14.5\" H English Bulldog body style|Great mascot statue for home, office or garden. This bulldog mascot is fabricated and sculpted from various unique quality materials including fiberglass and sealed bronze metal coatings for indoor or outdoor placement.|425|1'),('97','13',1,'KRC103|Enabled|None|Atlanta Georgia Neighborhoods Canvas|This is a funky typographic arrangement of Atlanta neighborhoods on an 18 x 24 x 1.5\" heavy duty 100% natural cotton duck, hand splined canvas.This is my original illustration on a 18 x 24\" x 1.5\" heavy duty 100% natural cotton duck, hand splined canvas. Created from my original design. Premium archival gallery wrapped canvas. My original design has been professionally wrapped by hand onto museum style 1.5\" premium canvas framework. The artwork is created using pigment inks for the highest image quality saturation, depth of color, and brilliance. Handmade by the artist, individually numbered, date stamped, and signed. Measures 18 x 24 x 1.5 (larger sizes available)|This is a funky typographic arrangement of Atlanta neighborhoods on an 18 x 24 x 1.5\" heavy duty 100% natural cotton duck, hand splined canvas.|179|1'),('96','12',1,'KRC102|Enabled|None|Georgia Red Tote Bag|14\" wide by 13\" high by 5\" deep (plenty of room for a laptop +). Removable clear acrylic base inside for stability. Sturdy enough to stand up on its own (actually 4 layers of fabric). Soft enough to fold for storage or travel. Magnetic clasp at the center top. Strong eco-friendly bamboo handles (each slightly different) are large enough for over-the-shoulder use. Side seams match. Tabs for handles made from same fabric as the exterior of the bag. The exterior of this bag is a vibrant fire-engine red printed raw cotton. The interior is a matching solid red cotton blend.|The exterior of this bag is a vibrant fire-engine red printed raw cotton. The interior is a matching solid red cotton blend.|115|1'),('95','11',1,'KRC101|Enabled|None|Cigar Box Speakers|This amp will make ears turn, eyes light up, and heads explode. The 15 watt class D audio amplifier is housed inside a reclaimed cigar box, with a purple PVC pipe stem protruding from the top, supporting a tweeter with a melted LP Victrola style horn. The combo woofer and tweeter provides a balanced tone, in style. A 3 ft cable with a 3.5mm jack is attached to plug into your favorite audio source, via the headphone jack of an an iPod, mp3 player, computer, etc... Perfect for a dorm room, or small apartment. Specs: 15Watt class D amplifier -on/off switch -volume knob -3.5mm headphone jack output cable attached -3.5\" woofer, and 2\" paper cone tweeter -AC adaptor included|The 15 watt class D audio amplifier is housed inside a reclaimed cigar box, with a purple PVC pipe stem protruding from the top, supporting a tweeter with a melted LP Victrola style horn.|125|1'),('94','10',1,'TJT104|Enabled|None|Cider and Wine Press|The fresh and vibrant flavor of juice pressed from a barrel of just-harvested fruit is far superior to any of the store-bought varieties. This classically designed barrel-shaped press makes quick and easy work of pressing fruit into juice at home. Enjoy the juice fresh, or use it to make cider or wine. The easy-to-use press works equally well on most types of your favorite fruit, from apples and grapes to citrus, berries, cherries and most varieties of stone fruit. Simple to use: load fruit into the 16-qt. wooden barrel, then turn a lever to press wooden blocks onto the fruit, forcing fresh juice through the barrel stays. Heavy-duty, rust-resistant enameled cast-iron and hardwood construction. Classic, centuries-old fruit-press design.|This classically designed barrel-shaped press makes quick and easy work of pressing fruit into juice at home.|295|1'),('93','9',1,'TJT103|Enabled|None|Cheese Trays, Bags and Sticker Set|This handy kit takes the guesswork out of packaging and organizing batches of fresh homemade cheese for storage and sharing. Place portions of the cheese on the wooden trays, enclose in the wax-sealed paper bags, then label with the type of cheese and the date. Wax-coated bags ensure cheese freshness and longevity. Slender wood trays slip easily into bags. Easy-to-use adhesive labels. Kit includes 4 trays, 8 bags, and 8 labels. 9 1/2\" x 5 1/4\" x 1 1/2\". Made in France.|This handy kit takes the guesswork out of packaging and organizing batches of fresh homemade cheese for storage and sharing. Place portions of the cheese on the wooden trays, enclose in the wax-sealed paper bags, then label with the type of cheese and the date.|25|1'),('92','8',1,'JJC104|Enabled|None|Cuisine Paper Towel Holder|Not your usual paper-towel holder, ours has rustic character and is a perfect complement to our other Cuisine pieces. 17\" wide x 5.5\" deep x 10\" high. Made of mango wood. Iron bar with blackened finish. Bar removes to insert paper towels.|Cuisine Paper Towel Holder made of mango wood and iron|65|1'),('87','3',1,'TRC103|Enabled|None|Georgia Combo Necklace|Represent the Lone Star State with this Dallas Texas Charm Necklace! Each piece is crafted by hand, using resin molds that I created myself. The opaque resin comes in colors makes the piece look almost like stone - interesting and unique! The necklace includes a 24-inch chain.|Dalas Texas Combo Necklace with 24 inch Chain|60|1'),('88','4',1,'TRC104|Enabled|None|Georgia Bulldog Earrings|Celebrate being a fan with these brass bulldog charm earrings on 14k gold filled earring hooks.|Brass Bulldog Charm Earrings on 14k Gold Hooks|45|1'),('89','5',1,'JJC101|Enabled|None|Mason Jar Mug Set|On the beach or on the front porch, our Mason-jar-inspired collection continues the American tradition of casual entertaining. 3\" Diameter, 5\" high. Holds 16oz. Made of molded glass. Set of 6|Mason Jar inspired Mugs - Set of 6|60|1'),('90','6',1,'JJC102|Enabled|None|Wire Basket with Burlap Liner|Easter morning takes on country farmhouse charm with this rustic basket. Fill it with eggs and goodies for the holiday, then use it to store anything from fruit to craft supplies during the rest of the year. 14.5\" diameter, 16.5\" high. Made of galvanized iron. Lined with natural jute.|Wire Basket with Burlap Liner - made of galvanized iron|90|1'),('91','7',1,'JJC103|Enabled|None|Linear Succulent Planter|Add a different succulent or air plant to each of these pockets for a display of contrasts in color and texture. Its vertical design adds height to your garden and is ideal for large or small spaces alike. 5.5\" wide x 4\" deep x 63\" high. Made of galvanized iron and finished in matte Pewter. Features 10 planters. Mounting hardware included. For indoor and outdoor display.|Linear Succulent Planter - 63\" high made of galvanized iron|95|1'),('85','1',1,'TRC101|Enabled|None|Georgia Charm Necklace - White|Represent the Peach State with this Georgia Charm Necklace! Each piece is crafted by hand, using resin molds that I created myself. The opaque white resin makes the piece look almost like stone - interesting and unique! The necklace includes a 24-inch chain.|Georgia State Charm Necklace with 24 inch Necklace Chain - White|45|1'),('101','15',1,'LRSTO1234000|Enabled|None|Bless Your Heart, Tailgater|Hosting your first tailgate in the south may seem like a daunting order. After all, tailgating is basically a religion south of the Mason Dixon line, and imposters are quickly sniffed out and thrown back to the other side. Enter Mersene Norbom, a Connecitut resident who wrote an article entitled &ldquo;The Backyard Family Tailgater &ndash; Throw a true Southern Tailgater for the Whole Family&rdquo; for her local newspaper back in October of 2012. You can read the article in its entirety here, but considering she used the word &ldquo;tailgat-er&rdquo; twice in the title alone, you can probably guess the effectiveness of the content. Not exactly sure how The South found out about this little gem, but fortunately for us they fired back in droves. Commence the following 60 seconds of pure entertainment: &hellip; Thank you, \"Mersene\" for providing a proper description of the worst party of all time. Please do everyone a favor and don\'t invite them over, ever.&hellip; You could put a Christmas tree up in the driveway in October, but it does not make it Christmas Eve.&hellip; I don\'t know that you could put ACC and SEC together at the same tailgate without at least one fight. Handshakes afterwards, of course...it is The South, after all.&hellip; What the hell is this croquet and baci nonsense? How about the game me and my brother play throwing empty beer bottles at each others nutsacks. &hellip;Now, I know you thought you had written the perfect southern tailgater article, but it didn\'t say anything about: Momma, Or trains, Or trucks, Or prison, Or gettin&rsquo; drunkAnd in closing &ndash; &hellip; Mersene&hellip;Bless your heart. I know you done the best you could&hellip;come on back. We can fix it.|Tailgate Party in the South|0|0');
