te a purchase or take advantage of certain features of our website, such as storing items in your Shopping Cart or receiving personalized recommendations. As a result, we strongly encourage you to configure your web browser to accept cookies from our website.</p>\r\n    <h2 class=\"subtitle\">Enabling Cookies</h2>\r\n    <ul class=\"disc\">\r\n        <li><a href=\"#ie7\">Internet Explorer 7.x</a></li>\r\n        <li><a href=\"#ie6\">Internet Explorer 6.x</a></li>\r\n        <li><a href=\"#firefox\">Mozilla/Firefox</a></li>\r\n        <li><a href=\"#opera\">Opera 7.x</a></li>\r\n    </ul>\r\n    <h3><a name=\"ie7\"></a>Internet Explorer 7.x</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Start Internet Explorer</p>\r\n        </li>\r\n        <li>\r\n            <p>Under the <strong>Tools</strong> menu, click <strong>Internet Options</strong></p>\r\n            <p><img src=\"{{skin url=\"images/cookies/ie7-1.gif\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click the <strong>Privacy</strong> tab</p>\r\n            <p><img src=\"{{skin url=\"images/cookies/ie7-2.gif\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click the <strong>Advanced</strong> button</p>\r\n            <p><img src=\"{{skin url=\"images/cookies/ie7-3.gif\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Put a check mark in the box for <strong>Override Automatic Cookie Handling</strong>, put another check mark in the <strong>Always accept session cookies </strong>box</p>\r\n            <p><img src=\"{{skin url=\"images/cookies/ie7-4.gif\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click <strong>OK</strong></p>\r\n            <p><img src=\"{{skin url=\"images/cookies/ie7-5.gif\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click <strong>OK</strong></p>\r\n            <p><img src=\"{{skin url=\"images/cookies/ie7-6.gif\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Restart Internet Explore</p>\r\n        </li>\r\n    </ol>\r\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\r\n    <h3><a name=\"ie6\"></a>Internet Explorer 6.x</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Select <strong>Internet Options</strong> from the Tools menu</p>\r\n            <p><img src=\"{{skin url=\"images/cookies/ie6-1.gif\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Privacy</strong> tab</p>\r\n        </li>\r\n        <li>\r\n            <p>Click the <strong>Default</strong> button (or manually slide the bar down to <strong>Medium</strong>) under <strong>Settings</strong>. Click <strong>OK</strong></p>\r\n            <p><img src=\"{{skin url=\"images/cookies/ie6-2.gif\"}}\" alt=\"\" /></p>\r\n        </li>\r\n    </ol>\r\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\r\n    <h3><a name=\"firefox\"></a>Mozilla/Firefox</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Click on the <strong>Tools</strong>-menu in Mozilla</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Options...</strong> item in the menu - a new window open</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Privacy</strong> selection in the left part of the window. (See image below)</p>\r\n            <p><img src=\"{{skin url=\"images/cookies/firefox.png\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Expand the <strong>Cookies</strong> section</p>\r\n        </li>\r\n        <li>\r\n            <p>Check the <strong>Enable cookies</strong> and <strong>Accept cookies normally</strong> checkboxes</p>\r\n        </li>\r\n        <li>\r\n            <p>Save changes by clicking <strong>Ok</strong>.</p>\r\n        </li>\r\n    </ol>\r\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\r\n    <h3><a name=\"opera\"></a>Opera 7.x</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Click on the <strong>Tools</strong> menu in Opera</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Preferences...</strong> item in the menu - a new window open</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Privacy</strong> selection near the bottom left of the window. (See image below)</p>\r\n            <p><img src=\"{{skin url=\"images/cookies/opera.png\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>The <strong>Enable cookies</strong> checkbox must be checked, and <strong>Accept all cookies</strong> should be selected in the &quot;<strong>Normal cookies</strong>&quot; drop-down</p>\r\n        </li>\r\n        <li>\r\n            <p>Save changes by clicking <strong>Ok</strong></p>\r\n        </li>\r\n    </ol>\r\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\r\n</div>\r\n','2013-02-16 13:56:13','2013-02-16 13:56:13',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(7,'Privacy Policy','one_column',NULL,NULL,'privacy-policy-cookie-restriction-mode','Privacy Policy','<p style=\"color: #ff0000; font-weight: bold; font-size: 13px\">\n    Please replace this text with you Privacy Policy.\n    Please add any additional cookies your website uses below (e.g., Google Analytics)\n</p>\n<p>\n    This privacy policy sets out how {{config path=\"general/store_information/name\"}} uses and protects any information\n    that you give {{config path=\"general/store_information/name\"}} when you use this website.\n    {{config path=\"general/store_information/name\"}} is committed to ensuring that your privacy is protected.\n    Should we ask you to provide certain information by which you can be identified when using this website,\n    then you can be assured that it will only be used in accordance with this privacy statement.\n    {{config path=\"general/store_information/name\"}} may change this policy from time to time by updating this page.\n    You should check this page from time to time to ensure that you are happy with any changes.\n</p>\n<h2>What we collect</h2>\n<p>We may collect the following information:</p>\n<ul>\n    <li>name</li>\n    <li>contact information including email address</li>\n    <li>demographic information such as postcode, preferences and interests</li>\n    <li>other information relevant to customer surveys and/or offers</li>\n</ul>\n<p>\n    For the exhaustive list of cookies we collect see the <a href=\"#list\">List of cookies we collect</a> section.\n</p>\n<h2>What we do with the information we gather</h2>\n<p>\n    We require this information to understand your needs and provide you with a better service,\n    and in particular for the following reasons:\n</p>\n<ul>\n    <li>Internal record keeping.</li>\n    <li>We may use the information to improve our products and services.</li>\n    <li>\n        We may periodically send promotional emails about new products, special offers or other information which we\n        think you may find interesting using the email address which you have provided.\n    </li>\n    <li>\n        From time to time, we may also use your information to contact you for market research purposes.\n        We may contact you by email, phone, fax or mail. We may use the information to customise the website\n        according to your interests.\n    </li>\n</ul>\n<h2>Security</h2>\n<p>\n    We are committed to ensuring that your information is secure. In order to prevent unauthorised access or disclosure,\n    we have put in place suitable physical, electronic and managerial procedures to safeguard and secure\n    the information we collect online.\n</p>\n<h2>How we use cookies</h2>\n<p>\n    A cookie is a small file which asks permission to be placed on your computer\'s hard drive.\n    Once you agree, the file is added and the cookie helps analyse web traffic or lets you know when you visit\n    a particular site. Cookies allow web applications to respond to you as an individual. The web application\n    can tailor its operations to your needs, likes and dislikes by gathering and remembering information about\n    your preferences.\n</p>\n<p>\n    We use traffic log cookies to identify which pages are being used. This helps us analyse data about web page traffic\n    and improve our website in order to tailor it to customer needs. We only use this information for statistical\n    analysis purposes and then the data is removed from the system.\n</p>\n<p>\n    Overall, cookies help us provide you with a better website, by enabling us to monitor which pages you find useful\n    and which you do not. A cookie in no way gives us access to your computer or any information about you,\n    other than the data you choose to share with us. You can choose to accept or decline cookies.\n    Most web browsers automatically accept cookies, but you can usually modify your browser setting\n    to decline cookies if you prefer. This may prevent you from taking full advantage of the website.\n</p>\n<h2>Links to other websites</h2>\n<p>\n    Our website may contain links to other websites of interest. However, once you have used these links\n    to leave our site, you should note that we do not have any control over that other website.\n    Therefore, we cannot be responsible for the protection and privacy of any information which you provide whilst\n    visiting such sites and such sites are not governed by this privacy statement.\n    You should exercise caution and look at the privacy statement applicable to the website in question.\n</p>\n<h2>Controlling your personal information</h2>\n<p>You may choose to restrict the collection or use of your personal information in the following ways:</p>\n<ul>\n    <li>\n        whenever you are asked to fill in a form on the website, look for the box that you can click to indicate\n        that you do not want the information to be used by anybody for direct marketing purposes\n    </li>\n    <li>\n        if you have previously agreed to us using your personal information for direct marketing purposes,\n        you may change your mind at any time by writing to or emailing us at\n        {{config path=\"trans_email/ident_general/email\"}}\n    </li>\n</ul>\n<p>\n    We will not sell, distribute or lease your personal information to third parties unless we have your permission\n    or are required by law to do so. We may use your personal information to send you promotional information\n    about third parties which we think you may find interesting if you tell us that you wish this to happen.\n</p>\n<p>\n    You may request details of personal information which we hold about you under the Data Protection Act 1998.\n    A small fee will be payable. If you would like a copy of the information held on you please write to\n    {{config path=\"general/store_information/address\"}}.\n</p>\n<p>\n    If you believe that any information we are holding on you is incorrect or incomplete,\n    please write to or email us as soon as possible, at the above address.\n    We will promptly correct any information found to be incorrect.\n</p>\n<h2><a name=\"list\"></a>List of cookies we collect</h2>\n<p>The table below lists the cookies we collect and what information they store.</p>\n<table class=\"data-table\">\n    <thead>\n        <tr>\n            <th>COOKIE name</th>\n            <th>COOKIE Description</th>\n        </tr>\n    </thead>\n    <tbody>\n        <tr>\n            <th>CART</th>\n            <td>The association with your shopping cart.</td>\n        </tr>\n        <tr>\n            <th>CATEGORY_INFO</th>\n            <td>Stores the category info on the page, that allows to display pages more quickly.</td>\n        </tr>\n        <tr>\n            <th>COMPARE</th>\n            <td>The items that you have in the Compare Products list.</td>\n        </tr>\n        <tr>\n            <th>CURRENCY</th>\n            <td>Your preferred currency</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER</th>\n            <td>An encrypted version of your customer id with the store.</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER_AUTH</th>\n            <td>An indicator if you are currently logged into the store.</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER_INFO</th>\n            <td>An encrypted version of the customer group you belong to.</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER_SEGMENT_IDS</th>\n            <td>Stores the Customer Segment ID</td>\n        </tr>\n        <tr>\n            <th>EXTERNAL_NO_CACHE</th>\n            <td>A flag, which indicates whether caching is disabled or not.</td>\n        </tr>\n        <tr>\n            <th>FRONTEND</th>\n            <td>You sesssion ID on the server.</td>\n        </tr>\n        <tr>\n            <th>GUEST-VIEW</th>\n            <td>Allows guests to edit their orders.</td>\n        </tr>\n        <tr>\n            <th>LAST_CATEGORY</th>\n            <td>The last category you visited.</td>\n        </tr>\n        <tr>\n            <th>LAST_PRODUCT</th>\n            <td>The most recent product you have viewed.</td>\n        </tr>\n        <tr>\n            <th>NEWMESSAGE</th>\n            <td>Indicates whether a new message has been received.</td>\n        </tr>\n        <tr>\n            <th>NO_CACHE</th>\n            <td>Indicates whether it is allowed to use cache.</td>\n        </tr>\n        <tr>\n            <th>PERSISTENT_SHOPPING_CART</th>\n            <td>A link to information about your cart and viewing history if you have asked the site.</td>\n        </tr>\n        <tr>\n            <th>POLL</th>\n            <td>The ID of any polls you have recently voted in.</td>\n        </tr>\n        <tr>\n            <th>POLLN</th>\n            <td>Information on what polls you have voted on.</td>\n        </tr>\n        <tr>\n            <th>RECENTLYCOMPARED</th>\n            <td>The items that you have recently compared.            </td>\n        </tr>\n        <tr>\n            <th>STF</th>\n            <td>Information on products you have emailed to friends.</td>\n        </tr>\n        <tr>\n            <th>STORE</th>\n            <td>The store view or language you have selected.</td>\n        </tr>\n        <tr>\n            <th>USER_ALLOWED_SAVE_COOKIE</th>\n            <td>Indicates whether a customer allowed to use cookies.</td>\n        </tr>\n        <tr>\n            <th>VIEWED_PRODUCT_IDS</th>\n            <td>The products that you have recently viewed.</td>\n        </tr>\n        <tr>\n            <th>WISHLIST</th>\n            <td>An encrypted list of products added to your Wishlist.</td>\n        </tr>\n        <tr>\n            <th>WISHLIST_CNT</th>\n            <td>The number of items in your Wishlist.</td>\n        </tr>\n    </tbody>\n</table>','2013-02-16 13:56:13','2013-02-16 13:56:13',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(8,'ABOUT','one_column',NULL,NULL,'about',NULL,'<div class=\"page-title\">\r\n<p align=\"center\"><span style=\"font-size: x-large;\"><strong>ABOUT US</strong></span></p>\r\n<p align=\"center\">&nbsp;</p>\r\n<div dir=\"ltr\">\r\n<div class=\"javascript source-javascript\">\r\n<pre class=\"de1\">&nbsp;</pre>\r\n</div>\r\n</div>\r\n<p align=\"center\">Legacy Row is a lifestyle brand that features small batch items, exclusive artisan collections, and journals that speak to today&rsquo;s enthusiasts who cherish their teams, their roots, and their Alma Maters.&nbsp; From handmade collectibles, to effortless entertaining, members enjoy an exclusive shopping experience focused on quality and convenience.</p>\r\n<p align=\"center\">&nbsp;</p>\r\n<p align=\"center\">Shop Legacy Row and enjoy the finer side of being a fan.</p>\r\n</div>\r\n<p>!!</p>\r\n<p>{{block type=\"core/template\" name=\"invite_block\" template=\"referafriend/invite_button.phtml\"}}</p>','2013-02-18 01:50:32','2013-03-20 20:48:10',1,0,NULL,'default/shopper',NULL,NULL,NULL,NULL),(10,'Join Legacy Row','empty',NULL,NULL,'splash',NULL,'<h1>Splash!</h1>\r\n<p>Sign in or sign up!</p>','2013-03-08 15:23:56','2013-03-08 15:24:09',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(11,'Signup Complete','empty',NULL,NULL,'confirm-signup',NULL,'<h1> THANKS FOR SIGNING UP WITH US! </h1>\r\n<a href=\"{{store url=\"\"}}\">Store Home</a>','2013-03-08 15:45:12','2013-03-08 15:48:04',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(12,'FAQ','one_column',NULL,NULL,'faq',NULL,'<div class=\"page-title\">\r\n<h1>FAQ</h1>\r\n</div>\r\n<div class=\"block horizontal-block\"><a name=\"basics\"></a>\r\n<p class=\"block-title\"><strong>THE BASICS</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>WHAT IS THE LEGACY ROW?</strong></p>\r\n<p>Legacy Row is a lifestyle brand that connects artisans with fans.&nbsp; Members receive a daily email announcing unique, limited-time Events.&nbsp; From team carvings, to bourbon bbq recipes, each event delivers a touch of the unexpected for today&rsquo;s enthusiast.&nbsp; It&rsquo;s your traditions, refined.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>WHY SHOULD I JOIN?</strong></p>\r\n<p>Legacy Row offers an exclusive shopping experience focused on quality products that speak to today&rsquo;s enthusiasts. Each day we offer a fresh selection that celebrates the finer side of being a fan.   You\'ll even get opportunities to earn Legacy Row credits - currency valid only at LegacyRow.com, which can be used toward your purchases.   All of this is absolutely free of charge.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>DOES IT COST ANYTHING TO JOIN?</strong></p>\r\n<p>No, Legacy Row is free for all to join.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>HOW DO I BECOME A MEMBER?</strong></p>\r\n<p>Anyone can register to become a member with a valid email address, or by signing in with Facebook.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>HOW ARE PRODUCTS, BRANDS, AND DESIGNERS SELECTED?</strong></p>\r\n<p>Legacy Row employs a team of experienced buyers who hand select every item on our site. &nbsp;Most of today&rsquo;s merchandise targeted to fans are cheaply made, mass produced, or cheesy trinkets.&nbsp; In contrast, all of the products featured on Legacy Row must live up to our high standards of lasting quality, value, and style.&nbsp; These are items that you have not seen before, and often can not buy anywhere else.</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"block horizontal-block\">\r\n<p class=\"block-title\"><strong>EVENTS &amp; EXCLUSIVES</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>WHAT ARE LEGACY ROW EVENTS?</strong></p>\r\n<p>Legacy Row members receive a daily email announcing unique, limited-time Events.&nbsp; From artisan team carvings, to bourbon BBQ recipes, each event delivers a touch of the unexpected for today&rsquo;s enthusiast.&nbsp; It&rsquo;s your traditions, refined.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>WHAT ARE LEGACY ROW EXCLUSIVES?</strong></p>\r\n<p>Legacy Row exclusives are a catalogue of legally licensed product that you can not find anywhere else.&nbsp; We have the best artisans in the country creating one-of-a-kind pieces that are as special as the teams, universities, and brands you love.&nbsp;&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>HOW MANY SALES EVENTS ARE OFFERED PER WEEK?</strong></p>\r\n<p>Legacy Row Events are announced daily, with products in a variety of home and lifestyle categories.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>HOW WILL I KNOW ABOUT EVENTS &amp; EXCLUSIVES?</strong></p>\r\n<p>Legacy Row members receive new Event emails daily.&nbsp; You can change your email preferences by signing into your account.</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"block horizontal-block\">\r\n<p class=\"block-title\"><strong>SHOPPING</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>DO YOU HAVE A PHYSICAL STORE LOCATION?</strong></p>\r\n<p>At this time, Legacy Row products are only available online. This allows us to pass the savings on to our members.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>WHAT PAYMENT METHODS DO YOU ACCEPT?</strong></p>\r\n<p>We accept the following methods of payment. No matter what method you choose, we guarantee that every transaction you make on our site will be 100% secure. All prices are listed in U.S. dollars.</p>\r\n<blockquote>  <strong>Credit Cards</strong>\r\n<blockquote> We currently accept Visa, MasterCard, American Express, and Discover cards. You can safely enter your entire credit card number via our secure server, which encrypts all submitted information.     </blockquote>\r\n<strong>Legacy Row Credits</strong>\r\n<blockquote> Legacy Row credits hold monetary value only at Legacy Row and can be earned in several ways. For more information on <a href=\"#credits\"><strong>Legacy Row Credits</strong></a>, visit section below.</blockquote>\r\n</blockquote>\r\n<p><strong>WHAT ARE YOUR SHIPPING POLICIES?</strong></p>\r\n<p>At Legacy Row, shipping is determined on a product-by-product basis. Most items are shipped within 5-7 days of an order and from the location of that particular artisan or producer. Some orders will take longer because they are custom orders or hand produced.&nbsp; Please visit our <a href=\"/shipping\"><strong>Shipping Policy</strong></a> page for more information, or email <a href=\"mailto:Help@LegacyRow.com\">Help@LegacyRow.com</a></p>\r\n<p>&nbsp;</p>\r\n<p><strong>ARE THE ITEMS IN MY CART RESERVED?</strong></p>\r\n<p>Unfortunately, because Legacy Row items are in high demand and available in limited quantities, we cannot reserve items in your cart until you confirm purchase.&nbsp; If the item is no longer available, we will alert you during the checkout process.&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>CAN I PURCHASE GIFT ITEMS FOR SOMEONE ELSE?</strong></p>\r\n<p>Yes, certainly! &nbsp;You can send your purchases to any qualifying address. You can also store multiple addresses for future use in your account\'s Address Book.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n</div>\r\n<div class=\"block horizontal-block\"><a name=\"credits\"></a>\r\n<p class=\"block-title\"><strong>LEGACY ROW CREDITS</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>WHAT ARE LEGACY ROW CREDITS?</strong></p>\r\n<p>Legacy Row credits hold monetary value only at Legacy Row, and you may apply them toward merchandise at LegacyRow.com.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>HOW DO I EARN CREDITS?</strong></p>\r\n<p>Currently, members can earn Legacy Row credits when invited friends register or when a registered friend buys. The amount of credits members earn is based on the current offering in place at the date of a member\'s registration. We\'re always looking for new ways for members to earn credits, so these opportunities may vary.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>HOW CAN I USE LEGACY ROW CREDITS?</strong></p>\r\n<p>Legacy Row Credits can be used to pay for merchandise at Legacy Row only. When using Legacy Row credits, shipping and any tax amount due must be paid with a credit card. Applicable tax is charged on any merchandise balance not covered by Legacy Row credits, and on shipping charges.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>CAN I SHARE LEGACY ROW CREDITS?</strong></p>\r\n<p>Legacy Row credits are non-transferrable. However, you can always use your Legacy Row credits to make a purchase for a friend.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n</div>\r\n<div class=\"block horizontal-block\">\r\n<p class=\"block-title\"><strong>ACCOUNT INFORMATION</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>HOW DO I CHECK THE STATUS OF AN OPEN ORDER?</strong></p>\r\n<p>You can view open orders by clicking on \"Account\" and then \"My Orders\"</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>HOW DO I TRACK A SHIPMENT?</strong></p>\r\n<p>Simply click on \"Account\" to find your order number, and use that to track your shipment.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>CAN I CANCEL AN ORDER?</strong></p>\r\n<p>We will do our best to accommodate your request. Please visit our <a href=\"/return-policy\"><strong>Return Policy</strong></a> or email us at <a href=\"mailto:Help@LegacyRow.com\">Help@LegacyRow.com</a> with details and we will get back to you as soon as possible.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>WHAT HAPPENS IF I FORGET MY PASSWORD?</strong></p>\r\n<p>If you\'ve forgotten your password, simply click the \"forgot password\" link at the sign-in screen and follow the simple step-by-step instructions.   You can access and/or change your password anytime by clicking on \"Account Dashboard\".</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>HOW DO I CHANGE E-MAIL NOTIFICATION SETTINGS?</strong></p>\r\n<p>You can change your email notification settings by clicking on \"Account&rdquo; and then &ldquo;Notifications&rdquo;.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>HOW DO I VIEW PAST ORDERS?</strong></p>\r\n<p>You can view past orders by clicking on \"Account\" and then \"My Orders\"</p>\r\n<p><strong>&nbsp;</strong></p>\r\n</div>\r\n<div class=\"block horizontal-block\">\r\n<p class=\"block-title\"><strong>RETURNS AND EXCHANGES</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>WHAT ARE YOUR RETURN AND EXCHANGE POLICIES?</strong></p>\r\n<p>If you&rsquo;re not satisfied with some of the items you ordered, we want to make your return or exchange as easy as possible.&nbsp; We do returns and exchanges for un-worn, un-used, un-washed, un-damaged, non-custom products. Just email us at <a href=\"mailto:Help@LegacyRow.com\">Help@LegacyRow.com</a><span style=\"text-decoration: underline;\">.</span> Items must be returned or exchanged within 21 days from receipt of merchandise in the original packaging and in original unused condition.&nbsp;Please return items in their original packaging, including: hangers, plastic wrap, hang tags on garments, boxes, dust bags, etc.&nbsp; Customized product sales are final and cannot be returned or exchanged.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>INCORRECT SHIPMENTS, DAMAGES OR DEFECTIVE PRODUCTS</strong></p>\r\n<p>If you have received an item that has been damaged in transit, we apologize and want to help.&nbsp; Please refer to our <a href=\"/shipping\"><strong>Shipping Policy</strong></a> page for next steps.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>HOW DO I INITIATE A RETURN ORDER?</strong></p>\r\n<p>Please contact us at <a href=\"mailto:Help@LegacyRow.com\">Help@LegacyRow.com</a><span style=\"text-decoration: underline;\">.</span> The information you provide will help us provide prompt assistance.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>IF I USED LEGACY ROW CREDITS TO MAKE A PURCHASE, WILL I BE REIMBURSED IN LEGACY ROW CREDITS?</strong></p>\r\n<p>Yes, you will be reimbursed with the method of payment you used to place the order.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n</div>\r\n<div class=\"block horizontal-block\">\r\n<p class=\"block-title\"><strong>MEDIA, DESIGNER &amp; OTHER INQUIRIES</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>I\'M A MEMBER OF THE PRESS. WHOM DO I CONTACT FOR PRESS-RELATED MATERIALS?</strong></p>\r\n<p>Please contact <a href=\"mailto:Press@LegacyRow.com\">Press@LegacyRow.com</a></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>I\'M A DESIGNER, ARTISAN, or VENDOR. WHOM DO I CONTACT TO HAVE MY PRODUCTS FEATURED?</strong></p>\r\n<p>Please contact <a href=\"mailto:Vendor@LegacyRow.com\">Vendor@LegacyRow.com</a></p>\r\n</div>','2013-03-14 17:05:24','2013-04-01 16:12:25',1,0,NULL,NULL,NULL,NULL,NULL,NULL);
