UNLOCK TABLES;

--
-- Table structure for table `spreadtheword_queue`
--

DROP TABLE IF EXISTS `spreadtheword_queue`;
CREATE TABLE `spreadtheword_queue` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `friend_id` int(11) unsigned NOT NULL,
  `data_id` int(11) unsigned NOT NULL,
  `status` int(3) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `FK_STW_QUEUE_DATA_ID` (`data_id`),
  KEY `FK_STW_FRIEND_ID` (`friend_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

--
-- Table structure for table `spreadtheword_queue_data`
--

DROP TABLE IF EXISTS `spreadtheword_queue_data`;
CREATE TABLE `spreadtheword_queue_data` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `template` varchar(100) NOT NULL DEFAULT '',
  `type` enum('noaction','discount') NOT NULL DEFAULT 'noaction',
  `discount_rule` int(11) DEFAULT NULL,
  `simple_action` varchar(32) NOT NULL,
  `promised_amount` decimal(12,4) DEFAULT NULL,
  `source` varchar(20) NOT NULL DEFAULT '',
  `store_id` smallint(5) unsigned NOT NULL DEFAULT '0',
  `sender_name` varchar(255) NOT NULL DEFAULT '',
  `sender_email` varchar(255) NOT NULL DEFAULT '',
  `personal_message` varchar(1000) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

--
-- Table structure for table `spreadtheword_queue_problems`
--

DROP TABLE IF EXISTS `spreadtheword_queue_problems`;
CREATE TABLE `spreadtheword_queue_problems` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `queue_id` int(11) unsigned NOT NULL,
  `failed_at` datetime DEFAULT NULL,
  `error_code` int(3) unsigned DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `FK_STW_PROBLEM_ID` (`queue_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

--
-- Table structure for table `spreadtheword_rules`
--

DROP TABLE IF EXISTS `spreadtheword_rules`;
CREATE TABLE `spreadtheword_rules` (
